import React, { FC } from 'react';
import style from '../styles/toolbar.module.scss';

const Toolbar: FC = () => {
      return (
            <div className={style.toolbar}>
                  <button className={style.toolbar__btn }/>
            </div>
      );
};

export default Toolbar;
